import React, { Component } from 'react';
import './App.css';

class Navbar extends Component {

  render() {
    return (
        <section data-aos="fade-down" class="headerText wrapper">
            <h1>
                <span class="headerfood">CHESS</span>
                <span class="headerfrogs">BYTES</span>
            </h1>
            <h3><span>UNIQUE</span> CHESS GAMES AND BOARDS MINTING ON THE WORLD'S 1ST CUSTOMIZABLE NFT CHESS MARKETPLACE</h3>
        </section>
    );
  }
}

export default Navbar;
